import Layout from '../components/Layout';
import Search from '../components/Search';

const Index = () => (

    <Layout>
        <div>
            <h2>CSC 648/848 SW Engineering Fall 2020</h2>
            <h3>Section 2<br/>Team 3</h3>

        </div>
        <div>    
            <Search/>
        </div>

        <div id="btn-wrapper">
            <div className="button-container"><a className="fire-btn" href="/wildfires_page">Wildfires</a>

            <a className="fire-btn" href="/covid_page">Coronavirus</a></div>
        </div>
    </Layout>   

);



export default Index;
